import React from 'react';
import { Markup, Page, Text } from 'components';
import matter from 'gray-matter';

const All = ({ content, data }) => {

    const frontmatter = data;

    return (
        <Page layout="default">
            <Text>{frontmatter.title}</Text>
            <Markup>{content}</Markup>
        </Page>
    )
}

All.getInitialProps = async (context) => {

    const content = await import(`./${context.query.file}.md`);

    const data = matter(content.default);

    return { ...data }
}

export default All;
